{
    "version": 3,
    "cmakeMinimumRequired": {
      "major": 3,
      "minor": 16,
      "patch": 3
    },
    "configurePresets": [
      {
        "name": "common",
        "hidden": true,
        "cacheVariables": {
          "CMAKE_EXPORT_COMPILE_COMMANDS": {
            "type": "BOOL",
            "value": "ON"
          }
        }
      },
      {
        "name": "debug",
        "displayName": "Debug",
        "description": "Default debug profile",
        "binaryDir": "${sourceDir}/build/debug",
        "inherits": [
          "common"
        ],
        "cacheVariables": {
          "CMAKE_BUILD_TYPE": {
            "type": "STRING",
            "value": "Debug"
          }
        }
      },
      {
        "name": "release",
        "displayName": "Release",
        "description": "Default release profile",
        "binaryDir": "${sourceDir}/build/release",
        "inherits": [
          "common"
        ],
        "cacheVariables": {
          "CMAKE_BUILD_TYPE": {
            "type": "STRING",
            "value": "Release"
          }
        }
      },
      {
        "name": "conda",
        "hidden": true,
        "generator": "Ninja",
        "cacheVariables": {
          "BUILD_FEM_NETGEN": {
            "type": "BOOL",
            "value": "ON"
          },
          "BUILD_WITH_CONDA": {
            "type": "BOOL",
            "value": "ON"
          },
          "ENABLE_DEVELOPER_TESTS": {
            "type": "BOOL",
            "value": "ON"
          },
          "FREECAD_LIBPACK_USE": {
            "type": "BOOL",
            "value": "OFF"
          },
          "FREECAD_USE_EXTERNAL_FMT": {
            "type": "BOOL",
            "value": "ON"
          },
          "FREECAD_USE_EXTERNAL_SMESH": {
            "type": "BOOL",
            "value": "ON"
          },
          "FREECAD_USE_PCH": {
            "type": "BOOL",
            "value": "OFF"
          },
          "FREECAD_USE_PCL": {
            "type": "BOOL",
            "value": "ON"
          },
          "FREECAD_USE_PYBIND11": {
            "type": "BOOL",
            "value": "ON"
          },
          "OCCT_CMAKE_FALLBACK": {
            "type": "BOOL",
            "value": "ON"
          },
          "QT_HOST_PATH": {
            "type": "PATH",
            "value": "$env{CONDA_PREFIX}"
          }
        }
      },
      {
        "name": "conda-linux",
        "hidden": true,
        "condition": {
            "type": "equals",
            "lhs": "${hostSystemName}",
            "rhs": "Linux"
        },
        "cmakeExecutable": "${sourceDir}/conda/cmake.sh",
        "cacheVariables": {
          "CMAKE_INCLUDE_PATH": {
            "type": "FILEPATH",
            "value": "$env{CONDA_PREFIX}/include"
          },
          "CMAKE_INSTALL_LIBDIR": {
            "type": "FILEPATH",
            "value": "$env{CONDA_PREFIX}/lib"
          },
          "CMAKE_INSTALL_PREFIX": {
            "type": "FILEPATH",
            "value": "$env{CONDA_PREFIX}"
          },
          "CMAKE_LIBRARY_PATH":{
            "type": "FILEPATH",
            "value": "$env{CONDA_PREFIX}/lib"
          },
          "CMAKE_PREFIX_PATH": {
            "type": "FILEPATH",
            "value": "$env{CONDA_PREFIX}"
          },
          "OCC_INCLUDE_DIR": {
            "type": "FILEPATH",
            "value": "$env{CONDA_PREFIX}/include/opencascade"
          }
        }
      },
      {
        "name": "conda-macos",
        "hidden": true,
        "condition": {
            "type": "equals",
            "lhs": "${hostSystemName}",
            "rhs": "Darwin"
        },
        "cmakeExecutable": "${sourceDir}/conda/cmake.sh",
        "cacheVariables": {
          "CMAKE_IGNORE_PREFIX_PATH": {
            "type": "STRING",
            "value": "/opt/homebrew;/usr/local/homebrew"
          },
          "CMAKE_INCLUDE_PATH": {
            "type": "FILEPATH",
            "value": "$env{CONDA_PREFIX}/include"
          },
          "CMAKE_INSTALL_LIBDIR": {
            "type": "FILEPATH",
            "value": "$env{CONDA_PREFIX}/lib"
          },
          "CMAKE_INSTALL_PREFIX": {
            "type": "FILEPATH",
            "value": "$env{CONDA_PREFIX}"
          },
          "CMAKE_LIBRARY_PATH":{
            "type": "FILEPATH",
            "value": "$env{CONDA_PREFIX}/lib"
          },
          "CMAKE_PREFIX_PATH": {
            "type": "FILEPATH",
            "value": "$env{CONDA_PREFIX}"
          },
          "OCC_INCLUDE_DIR": {
            "type": "FILEPATH",
            "value": "$env{CONDA_PREFIX}/include/opencascade"
          }
        }
      },
      {
        "name": "conda-windows",
        "hidden": true,
        "condition": {
            "type": "equals",
            "lhs": "${hostSystemName}",
            "rhs": "Windows"
        },
        "cmakeExecutable": "${sourceDir}/conda/cmake.cmd",
        "cacheVariables": {
          "CMAKE_INCLUDE_PATH": {
            "type": "FILEPATH",
            "value": "$env{CONDA_PREFIX}/Library/include"
          },
          "CMAKE_INSTALL_LIBDIR": {
            "type": "FILEPATH",
            "value": "$env{CONDA_PREFIX}/Library/lib"
          },
          "CMAKE_INSTALL_PREFIX": {
            "type": "FILEPATH",
            "value": "$env{CONDA_PREFIX}/Library"
          },
          "CMAKE_LIBRARY_PATH":{
            "type": "FILEPATH",
            "value": "$env{CONDA_PREFIX}/Library/lib"
          },
          "CMAKE_PREFIX_PATH": {
            "type": "FILEPATH",
            "value": "$env{CONDA_PREFIX}/Library"
          },
          "OCC_INCLUDE_DIR": {
            "type": "FILEPATH",
            "value": "$env{CONDA_PREFIX}/Library/include/opencascade"
          }
        }
      },
      {
        "name": "conda-debug",
        "hidden": true,
        "displayName": "Conda Debug",
        "description": "Conda debug profile",
        "inherits": [
          "debug",
          "conda"
        ]
      },
      {
        "name": "conda-release",
        "hidden": true,
        "displayName": "Conda Release",
        "description": "Conda release profile",
        "inherits": [
          "release",
          "conda"
        ]
      },
      {
        "name": "conda-linux-debug",
        "displayName": "Conda Debug",
        "description": "Conda debug profile",
        "inherits": [
          "conda-debug",
          "conda-linux"
        ]
      },
      {
        "name": "conda-linux-release",
        "displayName": "Conda Release",
        "description": "Conda release profile",
        "inherits": [
          "conda-release",
          "conda-linux"
        ]
      },
      {
        "name": "conda-macos-debug",
        "displayName": "Conda Debug",
        "description": "Conda debug profile",
        "inherits": [
          "conda-debug",
          "conda-macos"
        ]
      },
      {
        "name": "conda-macos-release",
        "displayName": "Conda Release",
        "description": "Conda release profile",
        "inherits": [
          "conda-release",
          "conda-macos"
        ]
      },
      {
        "name": "conda-windows-debug",
        "displayName": "Conda Debug",
        "description": "Conda debug profile",
        "inherits": [
          "conda-debug",
          "conda-windows"
        ],
        "cacheVariables": {
          "CMAKE_BUILD_TYPE": {
            "type": "STRING",
            "value": "RelWithDebInfo"
          }
        }
      },
      {
        "name": "conda-windows-release",
        "displayName": "Conda Release",
        "description": "Conda release profile",
        "inherits": [
          "conda-release",
          "conda-windows"
        ],
        "cacheVariables": {
          "FREECAD_RELEASE_PDB": {
            "type": "BOOL",
            "value": "OFF"
          }
        }
      }
    ]
}

function git_commit_no {
	commits=$(curl -s 'https://api.github.com/repos/FreeCAD/FreeCAD/compare/120ca87015...master' | grep "\"ahead_by\":" | sed -s 's/ //g' | sed -s 's/"ahead_by"://' | sed -s 's/,//')
	echo -n $((commits + 1))
}
